import React from "react";
import perrydedo from "../../assets/img/perrydedo.png"
import perrychoro from "../../assets/img/perrychoro.png"
import{ContentSection} from "./styles";

const EmConstrucao:React.FC =()=>{
    return(
        <div>
            <ContentSection>
                <img style ={{margin:'auto', display: 'table', width:'300px'}}src ={perrychoro}/>
                <p>Desculpe, esta página ainda está em desenvolvimento.</p>
            </ContentSection>
        </div>
    )
}
export default EmConstrucao;
